import { count } from 'console';
import React, { useEffect, useState } from 'react';
import './App.css';

interface MilkInformation {
  name: string;
  type: string;
  storage: number;
  id: string;
}

function App() {
  const [milkData, setMilkData] = useState<MilkInformation>();
  // const [milkName, setMilkName] = useState<string>();

  useEffect(() => {
    const getData = async () => {
      const response = await fetch(" https://localhost:7023/api/milk");
      const MilkResults = await response.json();
      setMilkData(MilkResults);
    }
    getData();
  }, [])
  var bla = milkData;
  console.log(bla)
  // var res = Object.entries(milkData);



  return (
    <div>
      {
        milkData?.results.map((m:any) => (
          <ul>
            <li key={m.name}>{m.name}</li>
            <li key={m.id}>{m.id}</li>
            <li key={m.storage}>{m.storage}</li>
            <li key={m.type}>{m.type}</li>
          </ul>
        ))
      };
      { }
    </div>
  );
}

export default App;
